import App from "./App"
import {HashRouter,Routes, Route,} from "react-router-dom"

function Router() {
  return (
    <HashRouter>
      <Routes>
      <Route path="/" component={<App/>} />
      </Routes>
    </HashRouter>
  );
}

export default Router;
